// src/components/OrdemServicoEditar.js
import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';

const OrdemServicoEditar = () => {
  const { id } = useParams();
  const [ordem, setOrdem] = useState({
    id: '',
    numero_protocolo: '',
    nome_solicitante: '',
    telefone_solicitante: '',
    data_abertura: '',
    data_agendamento: '',
    nome_empresa: '',
    endereco: '',
    problema_reportado: '',
    tipo_visita: '',
    modalidade: '',
    nome_tecnico: '',
    descricao_servico: '',
    estado_equipamento: '',
    nome_acompanhante: '',
    assinatura_acompanhante: '',
    assinatura_tecnico: '',
    imagens_servico: [],
    data_finalizacao: '',
    status: '',
    pecas_utilizadas: '',
    comentarios_observacoes: [],
    novo_comentario: ''
  });

  useEffect(() => {
    // Substituir pela chamada ao backend real
    const ordemMock = {
      id,
      numero_protocolo: 'PROTO123',
      nome_solicitante: 'João Silva',
      telefone_solicitante: '11999998888',
      data_abertura: '2025-05-01',
      data_agendamento: '2025-05-05',
      nome_empresa: 'FSW Saúde',
      endereco: 'Rua das Clínicas, 100',
      problema_reportado: 'Tela não acende',
      tipo_visita: 'Técnico',
      modalidade: 'Presencial',
      nome_tecnico: 'Carlos Souza',
      descricao_servico: '',
      estado_equipamento: '',
      nome_acompanhante: '',
      assinatura_acompanhante: '',
      assinatura_tecnico: '',
      imagens_servico: [],
      data_finalizacao: '',
      status: 'Aguardando Atendimento',
      pecas_utilizadas: '',
      comentarios_observacoes: ['Equipamento muito sujo.']
    };
    setOrdem(ordemMock);
  }, [id]);

  const handleChange = (e) => {
    setOrdem({ ...ordem, [e.target.name]: e.target.value });
  };

  const handleFileChange = (e) => {
    setOrdem({ ...ordem, imagens_servico: Array.from(e.target.files) });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Ordem de Serviço atualizada:', ordem);
    alert('Ordem de serviço salva com sucesso!');
  };

  const handleAddComentario = () => {
    if (ordem.novo_comentario.trim() !== '') {
      setOrdem({
        ...ordem,
        comentarios_observacoes: [...ordem.comentarios_observacoes, ordem.novo_comentario],
        novo_comentario: ''
      });
    }
  };

  return (
    <div style={{ padding: '20px' }}>
      <h2>Editar Ordem de Serviço</h2>
      <form onSubmit={handleSubmit}>
        {/* CAMPOS VISUALIZAÇÃO (Órbita App) */}
        {[
          ['Protocolo', 'numero_protocolo'],
          ['Solicitante', 'nome_solicitante'],
          ['Telefone', 'telefone_solicitante'],
          ['Data de Abertura', 'data_abertura'],
          ['Data de Agendamento', 'data_agendamento'],
          ['Empresa', 'nome_empresa'],
          ['Endereço', 'endereco'],
          ['Problema Reportado', 'problema_reportado'],
          ['Tipo de Visita', 'tipo_visita'],
          ['Modalidade', 'modalidade'],
          ['Técnico', 'nome_tecnico'],
        ].map(([label, field]) => (
          <div key={field}>
            <label>{label}:</label>
            <input type="text" value={ordem[field]} disabled />
          </div>
        ))}

        {/* CAMPOS EDITÁVEIS */}
        <div>
          <label>Descrição do Serviço:</label>
          <textarea
            name="descricao_servico"
            value={ordem.descricao_servico}
            onChange={handleChange}
          />
        </div>

        <div>
          <label>Estado do Equipamento:</label>
          <input
            type="text"
            name="estado_equipamento"
            value={ordem.estado_equipamento}
            onChange={handleChange}
          />
        </div>

        <div>
          <label>Nome do Acompanhante:</label>
          <input
            type="text"
            name="nome_acompanhante"
            value={ordem.nome_acompanhante}
            onChange={handleChange}
          />
        </div>

        <div>
          <label>Assinatura do Acompanhante (base64):</label>
          <input
            type="text"
            name="assinatura_acompanhante"
            value={ordem.assinatura_acompanhante}
            onChange={handleChange}
          />
        </div>

        <div>
          <label>Assinatura do Técnico (base64):</label>
          <input
            type="text"
            name="assinatura_tecnico"
            value={ordem.assinatura_tecnico}
            onChange={handleChange}
          />
        </div>

        <div>
          <label>Imagens do Serviço:</label>
          <input
            type="file"
            multiple
            onChange={handleFileChange}
          />
        </div>

        <div>
          <label>Data de Finalização:</label>
          <input
            type="date"
            name="data_finalizacao"
            value={ordem.data_finalizacao}
            onChange={handleChange}
          />
        </div>

        <div>
          <label>Status:</label>
          <select name="status" value={ordem.status} onChange={handleChange}>
            <option value="Aguardando Atendimento">Aguardando Atendimento</option>
            <option value="Em Pendencia">Em Pendência</option>
            <option value="Realizado Em Validação">Realizado Em Validação</option>
            <option value="Finalizado">Finalizado</option>
            <option value="Atrasado">Atrasado</option>
          </select>
        </div>

        <div>
          <label>Peças Utilizadas:</label>
          <input
            type="text"
            name="pecas_utilizadas"
            value={ordem.pecas_utilizadas}
            onChange={handleChange}
          />
        </div>

        <div>
          <label>Comentário / Observações:</label>
          <ul>
            {ordem.comentarios_observacoes.map((c, i) => (
              <li key={i}>{c}</li>
            ))}
          </ul>
          <textarea
            name="novo_comentario"
            value={ordem.novo_comentario}
            onChange={handleChange}
          />
          <button type="button" onClick={handleAddComentario}>Adicionar Comentário</button>
        </div>

        <button type="submit">Salvar Alterações</button>
      </form>
    </div>
  );
};

export default OrdemServicoEditar;
